import React, { useState } from "react";
import "../css/header.css";
import logo from "../brainster_space_logo.svg";

const Header = () => {
    const [ spaceBlog, setSpaceBlog ] = useState(false);
    const yelow = setSpaceBlog(true);
  return (
    <div className="header">
      <div className="logo">
        <img src={logo}></img>
      </div>
      <div>
        <ul>
          <li onClick={yelow} className={spaceBlog ? yelowUnderline : null}>SPACE БЛОГ</li>
          <li>НАСТАНИ</li>
          <li>CO-WORKING</li>
          <li>АКАДЕМИИ</li>
          <li>ПРОСТОР ЗА НАСТАНИ</li>
          <li>ПАРТНЕРСТВА</li>
        </ul>
      </div>
      <div className="prikluci">
        <ul>
          <li>
            <span>
              <i class="fa fa-plus" aria-hidden="true"></i>
            </span>
            ПРИКЛУЧИ СЕ
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Header;
